response.about:
Хорошие девочки спят в пижаме,
плохие – голыми,
умные – по ситуации;

Хорошие девочки верны мужу,
плохие – любовнику,
умные –обоим;

Хорошие девочки имеют работу,
плохие – спонсора,
умные – свой бизнес;

Хорошие девочки верят в чистую любовь,
плохие – в частую,
умные– в качественную;

Хорошие девочки одеваются аккуратно,
плохие – вызывающе,
умные – быстро;

Хорошие девочки лишаются девственности в первую брачную ночь,
плохие – при первом удобном случае,
умные –два-три раза;

Хорошие девочки верят мужчинам,
плохие – не верят мужчинам,
умные не верят никому;
